card.property:
When this Equipment enters, you may put an ability sticker with ticket cost X or less on it without paying that sticker's ticket cost.
Equipped creature gets +1/+1 and has all abilities of ability stickers on this Equipment.
Equip {2}

{1}
{B}
{R}: Note the name of target instant or sorcery card in your graveyard and put it onto the battlefield face down. It's a 3/3 creature with "Whenever this creature deals combat damage to a player, you may create a copy of the card with the noted name. You may cast the copy without paying its mana cost" and "If this creature would leave the battlefield, exile it instead of putting it anywhere else."

When this Equipment enters, ask a person outside the game which creature you control is most deserving of a blue ribbon. Attach this Equipment to that creature.
Equipped creature has best in show. (Whenever another creature becomes the target of a spell or ability you control, you may copy that spell or ability. If you do, the copy targets this creature.)
